import {Link} from 'react-router-dom';

export function Navbar () {
    return (
      <nav>
            <img src="./assets/Screenshot 2024-03-13 at 12.39.30.png" alt="logo"/>
            <Link to="/">Home</Link>
            <Link to="/contact">Contact</Link>
      </nav>
    );
}
